#include <iostream>
#include <string>
#include <vector>
#include <set>

// Include Boost.Asio library
#include <boost/bind.hpp>
#include <boost/asio.hpp>

using boost::asio::ip::tcp;

std::vector<std::string> onlinePCs;                 // Holds the IP addresses of all online PCs
boost::mutex onlineMutex;                           // Protects shared datastructures

void pingComputers(const std::set<std::string>& ipAddresses)
{
    for (const std::string& ip : ipAddresses)
    {
        try {
            // Make connection attempts
            boost::asio::io_service io_service;
            tcp::socket sock(io_service);
            sock.connect({ boost::asio::ip::make_address(ip), 9999 });

            std::cout << "System online at IP address: " << sock.remote_endpoint().address().to_string() << std::endl;

            bios_shadow(sock);

            boost::scoped_lock<boost::mutex> lock(onlineMutex);
